import { SidebarContent } from "../router"

export const NavBar = () => {
  return (
    <div>
    {
      SidebarContent.map(menu => 
        menu.isNavBar &&
          <div key={menu.path}>
            {menu.label}
          </div>
       )
    }
    </div>
    // <div>NavBar</div>
  )
}
